import React from "react";
import { Route, Redirect, Switch } from "react-router-dom";
import Homepage from "../homepage/Homepage";
import Dashboard from "../homepage/Dashboard";
import LoginForm from "../auth/LoginForm";
import SignupForm from "../auth/SignupForm";
import FoodList from "../food/FoodList";
import ClientList from "../clients/ClientList";
import ClientDetails from "../clients/ClientDetails";
import OrderList from "../orders/OrderList";
import OrderDetails from "../orders/OrderDetails";
import PurchaseList from "../purchases/PurchaseList";
import PurchaseDetails from "../purchases/PurchaseDetails";
import ProtectedRoute from "./ProtectedRoutes";

function Routes({ login, signup }) {
  console.log(login);
  return (
    <div>
      <Switch>
        <Route exact path="/">
          <Homepage />
        </Route>

        <Route exact path="/login">
          <LoginForm login={login} />
        </Route>

        <ProtectedRoute exact path="/home">
          <Dashboard />
        </ProtectedRoute>

        <ProtectedRoute exact path="/signup">
          <SignupForm signup={signup} />
        </ProtectedRoute>

        <ProtectedRoute exact path="/food">
          <FoodList />
        </ProtectedRoute>

        <ProtectedRoute exact path="/clients">
          <ClientList />
        </ProtectedRoute>

        <ProtectedRoute exact path="/clients/:id">
          <ClientDetails />
        </ProtectedRoute>

        <ProtectedRoute exact path="/orders">
          <OrderList />
        </ProtectedRoute>

        <ProtectedRoute exact path="/orders/:id">
          <OrderDetails />
        </ProtectedRoute>

        <ProtectedRoute exact path="/purchases">
          <PurchaseList />
        </ProtectedRoute>

        <ProtectedRoute exact path="/purchases/:id">
          <PurchaseDetails />
        </ProtectedRoute>

        <Redirect to="/" />
      </Switch>
    </div>
  );
}
export default Routes;
